/*1. Delete table customer, dim_date, movies, promocode, theater, bookings.*/

IF EXISTS (SELECT * FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = N'customer')
BEGIN DROP table customer END
IF EXISTS (SELECT * FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = N'dim_date')
BEGIN DROP table dim_date END
IF EXISTS (SELECT * FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = N'movies')
BEGIN DROP table movies END
IF EXISTS (SELECT * FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = N'promocode')
BEGIN DROP table promocode END
IF EXISTS (SELECT * FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = N'theater')
BEGIN DROP table theater END
IF EXISTS (SELECT * FROM INFORMATION_SCHEMA.TABLES WHERE TABLE_NAME = N'bookings')
BEGIN DROP table bookings END
GO


/*
2. Create tables:
*/

CREATE TABLE customer(
  Customer_Key int NOT NULL,
  Name varchar(110) DEFAULT NULL,
  Address varchar(255) DEFAULT NULL,
  City varchar(45) DEFAULT NULL,
  Zip int DEFAULT NULL,
  State varchar(45) DEFAULT NULL,
  Country varchar(45) DEFAULT NULL,
  Customer_ID int DEFAULT NULL,
  PRIMARY KEY(Customer_Key)
);

CREATE TABLE dim_date(
  date_key int NOT NULL,
  date date DEFAULT NULL,
  year int DEFAULT NULL ,
  month int DEFAULT NULL,
  day int DEFAULT NULL,
  week int DEFAULT NULL,
  quarter int DEFAULT NULL,
  day_in_week int DEFAULT NULL,
  month_name varchar(45) DEFAULT NULL,
  day_name varchar(45) DEFAULT NULL,
  PRIMARY KEY (date_key)
);

CREATE TABLE movies(
  Movie_Key INT not null,
  Title varchar(255) DEFAULT NULL,
  Rating decimal(10,2) DEFAULT NULL,
  Genre varchar(45) DEFAULT NULL,
  Movies_ID int DEFAULT NULL,
  PRIMARY KEY (Movie_Key)
);


CREATE TABLE promocode (
  PromoCode_Key INT not null,
  PromoCode varchar(45) DEFAULT NULL,
  PromoCode_ID int DEFAULT NULL,
  PRIMARY KEY (PromoCode_Key)
);


CREATE TABLE theater (
  Theater_Key INT not null,
  Theater_Name varchar(60) DEFAULT NULL,
  Theater_ParentGroup varchar(55) DEFAULT NULL,
  Country varchar(45) DEFAULT NULL,
  State varchar(45) DEFAULT NULL,
  City varchar(45) DEFAULT NULL,
  ZipCode int DEFAULT NULL,
  Theater_ID int DEFAULT NULL,
  PRIMARY KEY (Theater_Key)
)



CREATE TABLE bookings (
  Booking_Key INT ,
  FK_Customer_Key int DEFAULT NULL,
  FK_Date_Key int DEFAULT NULL,
  FK_Movies_Key int DEFAULT NULL,
  FK_Theater_Key int DEFAULT NULL,
  FK_PromoCode_Key int DEFAULT NULL,
  Sales decimal(20,2) DEFAULT NULL,
  TicketsSold int DEFAULT NULL,
  CancelledAmount decimal(20,2) DEFAULT NULL,
  CancelledQuantity int DEFAULT NULL,
  PromoCodeValue decimal(20,2) DEFAULT NULL,
  Booking_ID int DEFAULT NULL,
  PRIMARY KEY (Booking_Key),
/*  foreign KEY FK_Customer_idx (FK_Customer_Key),
  foreign KEY FK_Date_idx (FK_Date_Key),
  foreign KEY FK_Theatre_idx (FK_Theater_Key),
  foreign KEY FK_Movies_idx (FK_Movies_Key),
  foreign KEY FK_PromoCode_idx (FK_PromoCode_Key),
  */
  CONSTRAINT FK_Customer FOREIGN KEY (FK_Customer_Key) REFERENCES customer (customer_key),
  CONSTRAINT FK_Date FOREIGN KEY (FK_Date_Key) REFERENCES dim_date (date_key),
  CONSTRAINT FK_Movies FOREIGN KEY (FK_Movies_Key) REFERENCES movies (movie_key),
  CONSTRAINT FK_PromoCode FOREIGN KEY (FK_PromoCode_Key) REFERENCES promocode (promocode_key),
  CONSTRAINT FK_Theatre FOREIGN KEY (FK_Theater_Key) REFERENCES theater (theater_key)
)

